function CurrentForecast({ day, date, temp, location, icon, description }) {
  return (
      <div>
    <div>{day}</div>
    <div>{date}</div>
    <div>{temp}</div>
    <div>{location}</div>
    <div>{icon}</div>
    <div>{description}</div>
      </div>
  )
}

export default CurrentForecast
